import {NavLink} from 'react-router-dom'
import './App.css'
const Nav = () => {
  return (
    <div id='nav'>
        <NavLink className='nav-link' to='/'>Home</NavLink>
        <NavLink class>Products</NavLink>

    </div>
  )
}

export default Nav
